function custom_template(obj) {
    var data = $(obj.element).data();
    var text = $(obj.element).text();
    if (data && data['img_src']) {
        img_src = data['img_src'];
        template = $("<div style=\"display: flex; flex-direction: row; align-items: center;\"><img src=\"" + img_src + "\" style=\"width:50px;height:15px;\"/><div style=\"font-weight: 700;font-size:14pt;text-align:center;\">" + text + "</div></div>");
        return template;
    }
}
