function loadContent(page) {

    var xhttp = new XMLHttpRequest();
    xhttp.onreadystatechange = function () {
        if (this.readyState == 4 && this.status == 200) {
            document.getElementById("content").innerHTML = this.responseText;
            if (page == 'kontakt.php') checkbutton();
            if (page == 'home_body.php') translateHomeBodyPage(localStorage.getItem('lang'));
        }
    };
    xhttp.open("GET", page, true);
    xhttp.send();
    switch (page) {
        case 'kontakt.php': currentview = 6; break;
        case 'fur-zahnarzte.php': currentview = 5; break;
        case 'fur-patienten.php': currentview = 4; break;
        case 'uber-uns.php': currentview = 3; break;
        case 'preis-beispiele.php': currentview = 2; break;
        case '/': currentview = 1; break;
    }
}


